            console.error(err)
        }
        );

    //console.log(cars)
    return(
        <div className="cars">
          <div className="cars_row">
          {cars.map((car, index) =>
            <div key={car.name + index}>
                <h1>{car.name}</h1>
                <p>Price: {car.price}</p>
                <p>Year: {car.productionYear}</p>
                
                <hr/>
            </div>
            )}
          </div>
          <div className="navi">
            
              <ul className="navi__row">
